import React from 'react';
import { useParams } from 'react-router-dom';
import products from '../../products';
const PDP = () => {
    const params = useParams();
    const product = products.filter(a => a.id === params.productId);
    

    return (
        <div className="pdp">
            PDP
            {console.log(product)}
        </div>
    );
}
 
export default PDP;
